import React from 'react'

function Navbar() {
  return (
    <div className='w-full h-20 flex'>
    <ul className='w-full h-20 bg-blue-900 text-justify text-white text-lg' >
        <li>Home</li>
        <li>Contact</li>
        <li>About</li>
        <li>Services</li>

    </ul>
    </div>
  );
};


export default Navbar
